PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE members (
       id INTEGER PRIMARY KEY AUTOINCREMENT,
       name TEXT NOT NULL,
       email TEXT UNIQUE,
       phone TEXT,
       membership_type TEXT,
       membership_plan_id INTEGER,
       join_date TEXT DEFAULT (date('now'))
     , is_active INTEGER DEFAULT 1, address TEXT, birthday TEXT, photo_url TEXT, biometric_id TEXT, biometric_sensor_member_id TEXT);
CREATE TABLE settings (
       key TEXT PRIMARY KEY,
       value TEXT
     );
CREATE TABLE attendance (
       id INTEGER PRIMARY KEY AUTOINCREMENT,
       member_id INTEGER REFERENCES members(id) ON DELETE CASCADE,
       check_in_time TEXT NOT NULL,
       check_out_time TEXT
     , date TEXT);
CREATE TABLE classes (
       id INTEGER PRIMARY KEY AUTOINCREMENT,
       name TEXT NOT NULL,
       description TEXT,
       instructor TEXT,
       duration_minutes INTEGER
     );
CREATE TABLE class_schedules (
       id INTEGER PRIMARY KEY AUTOINCREMENT,
       class_id INTEGER REFERENCES classes(id) ON DELETE CASCADE,
       start_time TEXT NOT NULL,
       end_time TEXT NOT NULL,
       max_capacity INTEGER
     );
CREATE TABLE bookings (
       id INTEGER PRIMARY KEY AUTOINCREMENT,
       member_id INTEGER REFERENCES members(id) ON DELETE CASCADE,
       schedule_id INTEGER REFERENCES class_schedules(id) ON DELETE CASCADE,
       booking_time TEXT DEFAULT (datetime('now')),
       status TEXT DEFAULT 'confirmed'
     );
CREATE TABLE membership_plans (
       id INTEGER PRIMARY KEY AUTOINCREMENT,
       name TEXT NOT NULL,
       price REAL NOT NULL,
       duration_days INTEGER NOT NULL,
       description TEXT
     );
CREATE TABLE invoices (
       id INTEGER PRIMARY KEY AUTOINCREMENT,
       member_id INTEGER REFERENCES members(id) ON DELETE CASCADE,
       plan_id INTEGER REFERENCES membership_plans(id),
       amount REAL NOT NULL,
       due_date TEXT NOT NULL,
       status TEXT DEFAULT 'unpaid',
       created_at TEXT DEFAULT (datetime('now'))
     );
CREATE TABLE payments (
       id INTEGER PRIMARY KEY AUTOINCREMENT,
       invoice_id INTEGER REFERENCES invoices(id) ON DELETE CASCADE,
       amount REAL NOT NULL,
       payment_date TEXT DEFAULT (datetime('now')),
       payment_method TEXT,
       transaction_id TEXT
     );
CREATE TABLE member_biometrics (
       id INTEGER PRIMARY KEY AUTOINCREMENT,
       member_id INTEGER REFERENCES members(id) ON DELETE CASCADE,
       device_user_id TEXT UNIQUE,
       template TEXT,
       created_at TEXT DEFAULT (datetime('now'))
     );
CREATE TABLE security_logs (
            id INTEGER PRIMARY KEY AUTOINCREMENT,
            event_type TEXT NOT NULL,
            timestamp TEXT NOT NULL,
            details TEXT,
            member_id INTEGER,
            device_id TEXT,
            ip_address TEXT,
            created_at DATETIME DEFAULT CURRENT_TIMESTAMP,
            FOREIGN KEY (member_id) REFERENCES members (id)
        );
CREATE TABLE biometric_events (
            id INTEGER PRIMARY KEY AUTOINCREMENT,
            member_id INTEGER,
            biometric_id TEXT,
            event_type TEXT NOT NULL,
            device_id TEXT,
            timestamp TEXT NOT NULL,
            success BOOLEAN NOT NULL,
            error_message TEXT,
            raw_data TEXT,
            created_at DATETIME DEFAULT CURRENT_TIMESTAMP, sensor_member_id TEXT,
            FOREIGN KEY (member_id) REFERENCES members (id)
        );
DELETE FROM sqlite_sequence;
CREATE UNIQUE INDEX ux_members_phone ON members(phone) WHERE phone IS NOT NULL;
CREATE UNIQUE INDEX idx_members_biometric_id ON members(biometric_id) WHERE biometric_id IS NOT NULL;
CREATE INDEX idx_attendance_date ON attendance(date);
CREATE INDEX idx_attendance_member_date ON attendance(member_id, date);
CREATE INDEX idx_security_logs_timestamp ON security_logs(timestamp);
CREATE INDEX idx_security_logs_event_type ON security_logs(event_type);
CREATE INDEX idx_biometric_events_timestamp ON biometric_events(timestamp);
CREATE INDEX idx_biometric_events_member_id ON biometric_events(member_id);
CREATE INDEX idx_biometric_events_biometric_id ON biometric_events(biometric_id);
CREATE INDEX idx_members_biometric_sensor_member_id ON members(biometric_sensor_member_id) WHERE biometric_sensor_member_id IS NOT NULL;
CREATE INDEX idx_biometric_events_sensor_member_id ON biometric_events(sensor_member_id) WHERE sensor_member_id IS NOT NULL;
COMMIT;
